import React from 'react';
import { StyleSheet, Text, View, Button } from 'react-native';

export default function HomeScreen({ navigation }) {
  return (
    <View style={styles.container}>
      <Text style={styles.labelStyle}>Welcome to Skai Hub</Text>
      <View style={styles.buttonContainer}>
        <Button title="Call Dashboard" onPress={() => navigation.navigate('Dashboard')} />
        <Button title="Call Profile" onPress={() => navigation.navigate('Profile')} />
      </View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },

  labelStyle: {
    marginBottom: 20,
    fontWeight: 'bold',
    fontSize: 24,
  },
  buttonContainer: {
    marginTop: 10,
    flexDirection: 'row', // Align buttons horizontally
    justifyContent: 'space-around', // Spread buttons evenly
    width: '80%', // Adjust width as needed
  },
});
